function getElementByXpath(path)
{
  return document.evaluate(path, document, null, 2, null).stringValue;
}
function printLabel()
{

  parsedTitle1 = getElementByXpath("//html/body/div[4]/div[1]/div[2]/div[1]/div/div/div/div/div[1]/div[2]/div/div/div/div/div") + "<br>";
  //parsedTitle += getElementByXpath("//html/body/div[4]/div[2]/div[1]/div[1]/div/div[2]/div[1]") + "<br>";
  parsedTitle2 = getElementByXpath("//html/body/div[4]/div[2]/div[1]/div[1]/div/div[1]/div[2]/div[2]/div[1]") + "<br>";
  var count = prompt("How many labels?");
  for (let i = 0; i < count; i++)
  {
    document.open();
    document.write("<div style=\"line-height: 1.5;\">");
    document.write("<p style=\"background-repeat: no-repeat; background-size: 45%; background-position: right bottom; font-family: Verdana, sans-serif; font-size: 22px; background-image: " + imageBlob + ";\">");
    document.write(parsedTitle1);
    document.write(parsedTitle2 + "<br>");
    document.write((i + 1).toString() + " of " + count.toString() + "<br>");
    document.write("</p>");
    //document.write(parsedTitle + (i + 1).toString() + " of " + count.toString() + "<br>");
    document.write("</div>")
    window.print();
  }
    location.reload();
}